import React from 'react';
import {AppBar, Typography, Toolbar} from "@mui/material";


export const Appbar = ({children}) => {
    return (
        <AppBar sx={{zIndex: (theme) => theme.zIndex.drawer + 1}}>
            <Toolbar>
                <Typography variant="h6" noWrap component="div">
                    {children}
                </Typography>
            </Toolbar>

        </AppBar>
    )
}
